INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Et quo omnis eaque recusandae eos qui nihil.', 'Illo nihil suscipit reiciendis vel eos. Voluptatibus inventore ut assumenda ipsam et. Ut dolorem soluta et consequatur minus fugiat nesciunt. Enim ut unde accusamus natus voluptas.', 'Sed numquam ut in nisi. Quia qui aut in ea cupiditate soluta ullam quod. Deleniti sequi voluptatem qui nam totam autem esse. Eum dolores harum ea consequuntur.', '1994-12-02');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Non mollitia maxime qui cum et ad quaerat.', 'Non aut cumque voluptatem nihil dolorem dolores. Praesentium hic veniam nihil voluptas facere dignissimos fuga omnis. Voluptatem aut odit necessitatibus et et ducimus esse. Soluta pariatur saepe vel.', 'Praesentium voluptate repellendus maxime tenetur. Dolorum dicta laudantium consequatur natus ducimus ea. Nemo numquam vero et dolor.', '1997-07-03');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Beatae minima praesentium autem natus recusandae nesciunt.', 'Nihil aut ex reiciendis aut. Odio consequuntur maiores aut in. Sint ab quo molestiae occaecati sunt in earum.', 'Totam cumque accusantium optio nihil ipsa cum. Repudiandae voluptates quae quam repellat accusamus rem. Ratione et ipsa nesciunt facilis.', '1993-10-12');
